import { Container} from "react-bootstrap";
import Header from "./Components/Header";
import Footer from "./Components/Footer";
import 'bootstrap/dist/css/bootstrap.min.css'; //Bootstrap CSS


function App() {
  return (
  <BrowserRouter>
      <div>
        <Header/>
        <Container>
          <Routes>
            <Route path='/' element={<Home/>}/>
          </Routes>
        </Container>
        <Footer/>
      </div>
  </BrowserRouter>
  );
}

export default App;
